let codes=new Set;function generateCodes(){const e=document.getElementById("codeCount").value,t=document.getElementById("codeLength").value,n=document.getElementById("result");for(n.innerHTML="",codes.clear();codes.size<e;)codes.add(generateUniqueCode(t));codes.forEach((e=>{const t=document.createElement("p");t.textContent=e,n.appendChild(t)}))}function generateUniqueCode(e){const t="0123456789ACDFGHJKMNPRUWY";let n="";for(let o=0;o<e;o++){n+=t[Math.floor(25*Math.random())]}return n}function downloadCodes(){let e=Array.from(codes).join("\n"),t=new Blob([e],{type:"text/plain"}),n=document.createElement("a");n.href=window.URL.createObjectURL(t),n.download="codes.txt",n.click()}